    'rek_title_xsdmf_id': null,
    'rek_title': 'Autism-related dietary preferences mediate autism-gut microbiome associations',
    'rek_description_xsdmf_id': null,
    'rek_description': 'There is increasing interest in the potential contribution of the gut\u00a0microbiome\u00a0to\u00a0autism spectrum disorder\u00a0(ASD). However, previous studies have been underpowered and have not been designed to address potential confounding factors in a comprehensive way. We performed a large autism stool\u00a0metagenomics\u00a0study (n\u00a0= 247) based on participants from the Australian Autism Biobank and the Queensland Twin Adolescent Brain project. We found negligible direct associations between ASD diagnosis and the\u00a0gut microbiome. Instead, our data support a model whereby ASD-related restricted interests are associated with less-diverse diet, and in turn reduced microbial taxonomic diversity and looser stool consistency. In contrast to ASD diagnosis, our dataset was well powered to detect microbiome associations with traits such as age, dietary intake, and stool consistency. Overall, microbiome differences in ASD may reflect dietary preferences that relate to diagnostic features, and we caution against claims that the microbiome has a driving role in ASD.',
