    'rek_formatted_title': 'Autism-related dietary preferences mediate autism-gut microbiome associations',
    'rek_formatted_abstract_xsdmf_id': null,
    'rek_formatted_abstract': '<p>There is increasing interest in the potential contribution of the gut&nbsp;microbiome&nbsp;to&nbsp;autism spectrum disorder&nbsp;(ASD). However, previous studies have been underpowered and have not been designed to address potential confounding factors in a comprehensive way. We performed a large autism stool&nbsp;metagenomics&nbsp;study (n&nbsp;= 247) based on participants from the Australian Autism Biobank and the Queensland Twin Adolescent Brain project. We found negligible direct associations between ASD diagnosis and the&nbsp;gut microbiome. Instead, our data support a model whereby ASD-related restricted interests are associated with less-diverse diet, and in turn reduced microbial taxonomic diversity and looser stool consistency. In contrast to ASD diagnosis, our dataset was well powered to detect microbiome associations with traits such as age, dietary intake, and stool consistency. Overall, microbiome differences in ASD may reflect dietary preferences that relate to diagnostic features, and we caution against claims that the microbiome has a driving role in ASD.<\/p>',
